import React from "react";
import Card from "./Card";
import Frame from "../UI/Frame";

const CardExpenses = (props) => {
  return (
    <Frame className="expenses">
    {props.card.map((expenses) => (
      <Card
        date={expenses.date}
        name={expenses.title}
        cost={expenses.amount}
      />
      ))}
      {/* <Card
        date={props.card[4].date}
        name={props.card[4].title}
        cost={props.card[4].amount}
      /> */}
    </Frame>
  );
};

export default CardExpenses;
